import React from "react";

class Form extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      phrase: "",
      type: "",
    };

    //bind methods here:
    this.handleChange = this.handleChange.bind(this);
    this.handleSubmit = this.handleSubmit.bind(this);
  }

  handleChange(event) {
    this.setState({ value: event.target.value });
  }

  handleSubmit(event) {
    event.preventDefault();
  }

  getTranslation() {}

  render() {
    return (
      <div>
        <label>
          Select Type:
          <select value={this.state.value} onChnage={this.handleChange}>
            <option value="yoda">Yoda</option>
            <option value="sith">Sith</option>
            <option value="gungan">Gungan</option>
            <option value="huttese">Huttese</option>
            <option value="mandalorian">Mandalorian</option>
            <option value="cheunh">Cheunh</option>
          </select>
        </label>
        <h5>Enter Phrase Here:</h5>
        <input type="text"></input>

        <button type="submit" on> SUBMIT </button>
      </div>
    );
  }
}

export default Form;
